import React from 'react';

export const Header = () => {
    const style =  {
        listStyleType: "none",
        margin: 0,
        padding: 0,
        
      }
        return (
            <ul style={style}>
                <li>Files</li>
                <li>new File</li>
            </ul>
        )
}
